import React, { Component } from 'react'
import Link from 'next/link'

export default class Layout extends Component {
  render() {
    return (
      <div className="root">
        <headers>
            <Link href="/">
                <a>Home</a>
            </Link>
            <Link href="/about">
                <a>About</a>
            </Link>
            <Link href="/hirme">
                <a>Hirme</a>
            </Link>
        </headers>
        <h1>{this.props.title}</h1>
        {this.props.children}  
        <footer>
        </footer>
      </div>
    )
  }
}

